column8:
&nbsp;バッグの表面に15個のポケットがついており、そこに撮影したチェキプリントを入れて自分の好きなスタイルのバッグにすることができます。カラーはキナリとブラックの2種類。荷物もたっぷり入るA4サイズなのでふだん使いにピッタリです。
<BR /><BR />
■チェキ instax miniフィルム（54×86mm）用<BR>
■チェキプリント15枚収納<BR>
■素材：本体：綿100％<BR>
■ポケット：PVC（フタル酸不使用）<BR>
■サイズ：高さ約38cm／横幅約35cm／マチ約5cm／肩紐長さ約60cm<BR>
■重さ：約190g<BR>
■JAN：生成 4547410332049、黒 4547410332032<BR><!--レコメンドエリアここから-->

